info = ''
def decompose_data(data):
    binary_data = binascii.unhexlify(info)
    header = binary_data[:1]
    devide_id = binary_data[1:9]
    channel = binary_data[9:10]
    cmd_type = binary_data[10:11]
    packet_count  = int.from_bytes(binary_data[11:13], byteorder='big')
    packet_id  = int.from_bytes(binary_data[13:15], byteorder='big')
    packet_size  = int.from_bytes(binary_data[15:17], byteorder='big')
    actual_data  = data[17:17+packet_size]
    data_crc32 = int.from_bytes(binary_data[-4:], byteorder='big')
    return {"帧头":header,"设备序列号":devide_id,"通道号":channel,"命令类型":cmd_type,"总包数":packet_count ,"数据内容":{"包号":packet_id ,"包大小":packet_size },"校验":data_crc32} 


binary_data = binascii.unhexlify(info)
packet_size = len(binary_data) - 4
received_crc = (binary_data[-4] << 24) | (binary_data[-3] << 16) | (binary_data[-2] << 8) | binary_data[-1]
calculated_crc = calculate_crc32(binary_data[:-4], packet_size)

print(f"Received CRC: {received_crc}")
print(f"Calculated CRC: {calculated_crc}")
print(f"CRC is valid: {received_crc == calculated_crc}")
print(decompose_data(info))


